  state = {};
  render() {
    return (
      <Fragment>
        {animateList.map((item, key) => (
          <div className="infoSquareContainer" key={key}>
            <Fade bottom>
              <div className="infoSquare1"></div>
            </Fade>
            <Fade bottom>
              <div className="infoSquare2"></div>
